import React from 'react';
import { useParams } from 'react-router';
import { Col, Container, Row } from 'reactstrap';
import { ORDER } from '../../assets/Json/ORDER';
import './OrderDetails.css';
const OrderDetails = (props) => {
  let param = useParams();
  const i = parseInt(param.id);
  const data = ORDER[i];
  console.log('data', data);
  console.log('orders');

  return (
    <Container>
      <h4 className='pt-4 pb-5'>Order Details</h4>
      <div className='cardDetials'>
        <h4 className='text-light p-4 '>{data.distributor}</h4>
        <Row className='px-4'>
          <Col xs={2} sm={2} md={2} lg={2} xl={2} className='text-light'>
            Order ID
          </Col>
          <Col xs={6} sm={6} md={6} lg={6} xl={6} className='text-light'>
            : {data.id}
          </Col>
          <Col xs={2} sm={2} md={2} lg={2} xl={2} className='text-light'>
            Total Item
          </Col>
          <Col xs={2} sm={2} md={2} lg={2} xl={2} className='text-light'>
            : {data.totalItem}
          </Col>
        </Row>
        <Row className='px-4'>
          <Col xs={2} sm={2} md={2} lg={2} xl={2} className='text-light'>
            Order Date
          </Col>
          <Col xs={6} sm={6} md={6} lg={6} xl={6} className='text-light'>
            : {data.date}
          </Col>
          <Col xs={2} sm={2} md={2} lg={2} xl={2} className='text-light'>
            Amount
          </Col>
          <Col xs={2} sm={2} md={2} lg={2} xl={2} className='text-light'>
            {' '}
            : {data.amount}
          </Col>
        </Row>
        <Row className='px-4'>
          <Col xs={2} sm={2} md={2} lg={2} xl={2} className='text-light'>
            Address
          </Col>
          <Col xs={6} sm={6} md={6} lg={6} xl={6} className='text-light'>
            : {data.address}
          </Col>
          <Col xs={2} sm={2} md={2} lg={2} xl={2} className='text-light'>
            Status
          </Col>
          <Col className='text-light'> : {data.status}</Col>
        </Row>
      </div>
    </Container>
  );
};

export default OrderDetails;
